contract HashDice {
    struct BetOrder{
        address owner;
        uint256 roomId;
        uint256 roundId;
        uint256 orderId;
        uint256 totalValue;
        uint256 gain;
        uint256 betType;
        uint256[] betValue;
        uint256[] betTailInfo;
    }

    struct Round{
        uint256 roundId;
        uint256 startBlock;
        uint256 totalBetValue;
        uint256 gain;
        uint256 compensate;
        uint256 orderNum;
        uint256 timeStamp;
        mapping(uint256 => BetOrder) orders;
    }

    struct Room{
        address creator; //RoomOwner
        address erc20Addr; //ERC20 token address
        string symbol; //Token name
        string name; //Room name
        uint256 id; //Unique room ID
        uint256[4] nominator; //0:Odd, 1:Even, 2:char, 3:tail
        uint256[4] denominator; //0:Odd, 1:Even, 2:char, 3:tail
        uint256 round; //Current round
        bool active;
        bool roundActive;
        uint256 currentMaxCompensate;
        uint256 lastLockedValue; //Locked token value after last round
        mapping(uint256 => Round) rounds;
    }

    event RoomOpened(
        address creator, //RoomOwner
        address erc20Addr, //ERC20 token address
        string symbol, //Token name
        string name, //Room name
        uint256 id, //Unique room ID
        uint256 lastLockedValue //Locked token value after last round
    );

    event RoomClosed(
        uint256 roomId
    );

    event Withdrawed(
        uint256 roomId,
        uint256 value,
        uint256 remained
    );

    event Deposited(
        uint256 roomId,
        uint256 value,
        uint256 remained
    );

    event RoundOpened(
        uint256 roomId,
        uint256 roundId,
        uint256 startBlock,
        uint256 lockedValue,
        uint256 timeStamp
    );
    event RoundClosed(
        uint256 roomId,
        uint256 roundId,
        uint256 totalBetValue,
        uint256 compensate,
        uint256 orderNum
    );

    event NewBetOrder(
        uint256 roomId,
        uint256 roundId,
        uint256 orderId,
        uint256 value
    );

    event CloseRoundTooLate(
        uint256 current,
        uint256 start
    );

    event DebugAA(
        uint256 block,
        uint256 start
    );

    event PayBetOwner(
        uint256 roomId,
        uint256 roundId,
        uint256 orderId,
        uint256 value
    );

    address public gOwner;
    uint256 public gRoomId;
    uint256 public gProfitRatio;
    uint256 public gRoundWait;
    uint256 public gRoundPeriod;

    mapping(uint256 => Room) rooms;
    mapping(address => uint256) profits;

    constructor() public payable{
        gOwner = msg.sender;
		gRoomId = 0;
        gProfitRatio = 100; //Default is 1%, UNIT is 10000
        gRoundWait = 20; //default is 30
        gRoundPeriod = 2; //default 10
 	}

    function CheckTransferFrom(
        address erc20Addr,
        address from,
        address to,
        uint256 value
    ) internal returns (bool){
        //First check whether msg.sender has enough tokens
        ERC20 token = ERC20(erc20Addr);
        uint256 totalBalance = token.balanceOf(from);
        require(value > 0, "Must transfer some tokens!");
        require(value <= totalBalance, "Cannot above current holdings!");
        uint256 spendable = token.allowance(
            from,
            to
        );
        if (spendable != 0) {
            spendable = (totalBalance < spendable) ? totalBalance : spendable;
        }
        require(spendable >= value, "Must approve locked tokens before.");

        //Final tranfer bet valule to contract
        return token.transferFrom(from, to, value);
    }

    function CheckTransfer(
        address erc20Addr,
        address to,
        uint256 value
    ) internal returns (bool) {
        ERC20 token = ERC20(erc20Addr);
        uint256 balance = token.balanceOf(address(this));
        require(balance >= value, "Not enough money :(!");
        //Do the real token transfer
        return token.transfer(to, value);
    }

    function GetBetOrder(
        uint256 roomId,
        uint256 roundId,
        uint256 orderId
    ) public view returns(address, uint256, uint256, uint256, uint256[] memory, uint256[] memory) {
        require(roomId > 0 && roundId > 0 && orderId > 0);
        Room storage room = rooms[roomId];
        Round storage round = room.rounds[roundId];
        BetOrder storage order = round.orders[orderId];
        return (order.owner, order.totalValue, order.gain, order.betType, order.betValue, order.betTailInfo);
    }

    function GetRoundInfo(
        uint256 roomId,
        uint256 roundId
    ) public view returns(uint256, uint256, uint256, uint256, uint256,uint256) {
        require(roomId > 0 && roundId > 0);
        Room storage room = rooms[roomId];
        Round storage round = room.rounds[roundId];
        return (round.startBlock, round.totalBetValue, round.gain, round.compensate, round.orderNum,round.timeStamp);
    }

    function GetRoomInfo(
        uint256 roomId
    ) public view returns(address, address, string memory, string memory, 
            uint256[4] memory, uint256[4] memory, uint256, bool, bool, uint256, uint256) {
        require(roomId > 0);
        Room storage room = rooms[roomId];
        return (room.creator, room.erc20Addr, room.symbol, room.name,
            room.nominator, room.denominator, room.round, room.active, room.roundActive,
            room.currentMaxCompensate, room.lastLockedValue);
    }

    function GetRooms() public view returns (uint256) {
        return gRoomId;
    }

    function GetProfitRatio() public view returns (uint256) {
        return gProfitRatio;
    }

    function SetProfitRatio(uint256 ratio) public {
        require(ratio < 10000, "Cannot exceed profit UNIT!");
        require(msg.sender == gOwner, "Only allow contract owner to set!");
        gProfitRatio = ratio;
    }

    function GetRoundWait() public view returns (uint256) {
        return gRoundWait;
    }

    function SetRoundWait(uint256 value) public {
        require(msg.sender == gOwner, "Only allow contract owner to set!");
        gRoundWait = value;
    }

    function GetRoundPeriod() public view returns (uint256) {
        return gRoundPeriod;
    }

    function SetRoundPeriod(uint256 value) public {
        require(msg.sender == gOwner, "Only allow contract owner to set!");
        gRoundPeriod = value;
    }

    function OpenRoom(
        address erc20Addr, 
        string memory symbol, 
        uint256 initLockedValue, 
        string memory roomName, 
        uint256[4] memory nominator,
        uint256[4] memory denominator
    ) public payable returns(uint256 roomId){
        require(erc20Addr != address(0));
        require(initLockedValue > 0);
        //Must meet (0 < nonimator <= denominator)
        for (uint i=0; i<4; i++) {
            require(nominator[i] > 0 && nominator[i] <= denominator[i]);
        }

        //Do the real token transfer, after that the token is locked in the contract.
        if (CheckTransferFrom(erc20Addr, msg.sender, address(this), initLockedValue)) {
            gRoomId = SafeMath.add(gRoomId,1);

            Room memory newRoom;
            newRoom.creator = msg.sender;
            newRoom.id = gRoomId;
            newRoom.symbol = symbol;
            newRoom.erc20Addr = erc20Addr;
            newRoom.name = roomName;
            newRoom.nominator = nominator;
            newRoom.denominator = denominator;
            newRoom.currentMaxCompensate = 0;
            newRoom.lastLockedValue = initLockedValue;
            newRoom.roundActive = false;
            newRoom.active = true;

            rooms[gRoomId] = newRoom; //Automatically copy it from memory to storage
            emit RoomOpened(msg.sender, erc20Addr, symbol, roomName, gRoomId, initLockedValue);

            OpenRound(gRoomId,0,0);
            return gRoomId;
        } else {
            return 0;
        }
    }

    function CloseRoom(
        uint256 roomId
    ) public payable {
        require(roomId > 0);
        Room storage room = rooms[roomId];
        //Only allow room owner to withdraw money
        require(room.creator == msg.sender, 
            "Only allow room owner to withdraw money!");
        //Close active round first
        if (room.roundActive) {
            CloseRound(roomId, room.round);
        }
        //Finally return back the locked tokens to room creator
        if(room.lastLockedValue > 0){
            //Do the real token transfer, after that the token is locked in the contract.
            if(CheckTransfer(room.erc20Addr, room.creator, room.lastLockedValue)) {
                room.lastLockedValue = 0;
            }
        }
        room.active = false;
        emit RoomClosed(roomId);
    }

    function GetProfit(
        address erc20Addr
    ) public view returns (uint256) {
        return profits[erc20Addr];
    }

    function WithdrawProfit(
        address erc20Addr,
        uint256 value,
        address receiver
    ) public payable {
        require(erc20Addr != address(0) && value > 0 && receiver != address(0));
        require(gOwner == msg.sender, 
            "Only allow contract owner to withdraw profit money!");
        require(value <= profits[erc20Addr], "Withdraw profit over money!");
        //Do the real token transfer
        if(CheckTransfer(erc20Addr, receiver, value)) {
            profits[erc20Addr] = SafeMath.sub(profits[erc20Addr], value);
        }
    }

    function Withdraw(
        uint256 roomId,
        uint256 value,
        address receiver
    ) public payable {
        require(roomId > 0);
        Room storage room = rooms[roomId];
        //Only allow room owner to withdraw money
        require(room.creator == msg.sender, 
            "Only allow room owner to withdraw money!");
        require(!room.roundActive, "Only no active round can withdraw money!");
        require(value <= room.lastLockedValue, "Withdraw over money!");
        //Finally return back the locked tokens to room creator
        if(room.lastLockedValue > 0){
            //Do the real token transfer
            if(CheckTransfer(room.erc20Addr, receiver, value)) {
                room.lastLockedValue = SafeMath.sub(room.lastLockedValue, value);
            }
        }
        emit Withdrawed(roomId, value, room.lastLockedValue);
    }

    function Deposit(
        uint256 roomId,
        uint256 value
    ) public payable {
        require(roomId > 0 && value > 0);
        Room storage room = rooms[roomId];
        //Do the real token transfer, after that the token is locked in the contract.
        if (CheckTransferFrom(room.erc20Addr, msg.sender, address(this), value)) {
            room.lastLockedValue = SafeMath.add(room.lastLockedValue, value);
        }

        emit Deposited(roomId, value, room.lastLockedValue);
    }

    function OpenRound(
        uint256 roomId,
        uint256 startBlock,
        uint256 value
    ) public payable returns(uint256 roundId){
        require(roomId > 0);
        Room storage room = rooms[roomId];
        //Only allow room owner and contract owner to open new round
        require(room.creator == msg.sender, 
            "Only allow room owner to open new round");
        require(room.active, "The room is not actived!");
        require(room.roundActive == false, "Previous round must be closed to open a new round!");

        Round storage lastRound = room.rounds[room.round];
        if (startBlock == 0) {
            startBlock = SafeMath.add(block.number, gRoundWait);
        } else {
            require(SafeMath.add(block.number, gRoundWait) <= startBlock, 
                "New round start block should be in the feature!");
        }

        require(room.round == 0 || SafeMath.add(lastRound.startBlock + 10, gRoundPeriod) <= startBlock, 
            "Two rounds period must above 10 blocks!");
        require(room.lastLockedValue > 0, "Must have tokens to start new round!");

        if (value > 0 && room.creator == msg.sender) {
            //Allow room owner to increase locked token for a new round
            if (CheckTransferFrom(room.erc20Addr, msg.sender, address(this), value)){
                room.lastLockedValue = SafeMath.add(room.lastLockedValue, value);
            }
        }

        Round memory newRound;
        newRound.startBlock = startBlock;
        newRound.totalBetValue = 0;
        newRound.compensate = 0;
        newRound.orderNum = 0;
        newRound.timeStamp=block.timestamp;
        room.round = SafeMath.add(room.round, 1);
        newRound.roundId = room.round;
        room.rounds[room.round] = newRound; //Automatically copy it from memory to storage
        room.roundActive = true;
        room.currentMaxCompensate = 0;
        emit RoundOpened(roomId, room.round, startBlock, room.lastLockedValue,block.timestamp);
        return room.round;
    }

    /*
     * We allow anyone to call CloseRound to trigger the hash result
     * --> Bet order owner should call it asap if he wins and detect room or game owner corruption.
     * --> Room owner should call it asap if he wins and detect game owner corruption.
     * --> Normally Game owner should call it after some blocks of open round.
     */
    function CloseRound(
        uint256 roomId,
        uint256 roundId
    ) public payable{
        require(roomId > 0);
        Room storage room = rooms[roomId];
        require((roundId == room.round) && room.roundActive, "Only allow close current active round");
        require(room.active, "The room is not actived!");
        Round storage round = room.rounds[roundId];
        emit DebugAA(block.number, round.startBlock);
        //Because we can only retrieve the latest 256 block hash
        require(block.number > SafeMath.add(round.startBlock, 10), 
            "Close round must happen after between 10~246 blocks!");

        ERC20 token = ERC20(room.erc20Addr);
        if(block.number > SafeMath.add(round.startBlock, 246)){
            //It's too late to close one round, we cannot get the block hash
            //the only choice is to return back all bet orders for current round.
            for (uint256 i=1; i<=round.orderNum; i++){
                //Directly return back bet values
                token.transfer(round.orders[i].owner, round.orders[i].totalValue);
            }
            emit CloseRoundTooLate(block.number, round.startBlock);
        } else {
            //Now we should compensate each one according to block hashes.
            round.compensate = 0;
            for (uint8 i=0; i<10; i++){
                uint256 blockHash = uint256(blockhash(round.startBlock + i));
                uint8 blockHashTail = uint8(blockHash & 0xF);
                bool isChar = (blockHashTail >= 10 && blockHashTail <=15);
                bool isOdd = (!isChar && ((blockHashTail & 0x1) == 0x1));
                bool isEven = (!isChar && !isOdd);

                for (uint256 j=1; j<=round.orderNum; j++){
                    uint8 count = 0;
                    if (((round.orders[j].betType & 0x1) == 0x1)){
                        if((round.orders[j].betValue[count*10 + i] > 0) && isOdd){
                            //bet order owner wins odd!
                            round.orders[j].gain = SafeMath.add(round.orders[j].gain, 
                                round.orders[j].betValue[count*10 + i] * room.denominator[0] / room.nominator[0]);
                        }
                        count++;
                    }
                    if (((round.orders[j].betType & 0x2) == 0x2)){
                        if((round.orders[j].betValue[count*10 + i] > 0) && isEven){
                            //bet order owner wins even!
                            round.orders[j].gain = SafeMath.add(round.orders[j].gain, 
                                round.orders[j].betValue[count*10 + i] * room.denominator[1] / room.nominator[1]);
                        }
                        count++;
                    }
                    if (((round.orders[j].betType & 0x4) == 0x4)){
                        if((round.orders[j].betValue[count*10 + i] > 0) && isChar){
                            //bet order owner wins char!
                            round.orders[j].gain = SafeMath.add(round.orders[j].gain, 
                                round.orders[j].betValue[count*10 + i] * room.denominator[2] / room.nominator[2]);
                        }
                        count++;
                    }
                }
            }

            for (uint256 i=1; i<=round.orderNum; i++){
                uint256 n = 0;
                if (((round.orders[i].betType & 0x1) == 0x1)){
                    n++;
                }
                if (((round.orders[i].betType & 0x2) == 0x2)){
                    n++;
                }
                if (((round.orders[i].betType & 0x4) == 0x4)){
                    n++;
                }
                n = n * 10;
                if (((round.orders[i].betType & 0x8) == 0x8)){
                    uint256 total_block = round.orders[i].betValue[n++];
                    for (uint256 j=0; j<total_block; j++) {
                        uint256 block_num = round.orders[i].betValue[n++];
                        uint256 blockHash = uint256(blockhash(round.startBlock + block_num));
                        uint8 blockHashTail = uint8(blockHash & 0xF);
                        uint256 tail_num = round.orders[i].betValue[n++];
                        for (uint256 k=0; k<tail_num; k++) {
                            if (round.orders[i].betValue[n] == blockHashTail) {
                                //bet order owner wins char!
                                round.orders[i].gain = SafeMath.add(round.orders[i].gain, 
                                    round.orders[i].betValue[n+1] * room.denominator[3] / room.nominator[3]);
                            }
                            n+=2;
                        }
                    }
                }
            }

            for (uint256 i=1; i<=round.orderNum; i++){
                if (round.orders[i].gain > 0) {
                    round.compensate = SafeMath.add(round.compensate, round.orders[i].gain);
                }
            }
            //require(SafeMath.add(room.lastLockedValue, round.totalBetValue) >= round.compensate, 
            //    "No enough money for compesate!");
            //In case of no money for compensation, though it should not happen because we alreay limit
            //  submmit order if exceed maximum compensation.
            //First we pay the betor
            for (uint256 i=1; i<=round.orderNum; i++){
                if (round.orders[i].gain > 0) {
                    //Pay the betor
                    token.transfer(round.orders[i].owner, round.orders[i].gain);
                    emit PayBetOwner(roomId, roundId, i, round.orders[i].gain);
                }
            }
            //Then pay the profit ratio
            uint256 profit = round.totalBetValue * gProfitRatio / 10000;
            profits[room.erc20Addr] = SafeMath.add(profits[room.erc20Addr], profit);
            //Finally pay the room owner
            room.lastLockedValue = SafeMath.add(room.lastLockedValue, round.totalBetValue - profit);
            room.lastLockedValue = SafeMath.sub(room.lastLockedValue, round.compensate);
        }
        room.roundActive = false;
        emit RoundClosed(roomId, roundId, round.totalBetValue, round.compensate, round.orderNum);
    }

    /*
     * @param betType, betType format is 4 bit |tail|char|even|odd|
     * @param betValue, betValue is 10 values per each bit in betType
     */
    function SubmitBetOrder(
        uint256 roomId, 
        uint256 roundId,
        uint256 betType, 
        uint256[] memory betValue
    ) public payable returns (uint256){
        require(roomId > 0);
        Room storage room = rooms[roomId];
        uint8 betType8 = uint8(betType & 0xF);
        require(betType8 != 0, "Invalid type!");
        require((roundId == room.round) && room.roundActive, "Only allow bet for current actived round!");
        require(room.active, "The room is not actived!");

        //Pre-calculate the maximum compensate and check whether 
        //room owner can pay the maximum compensate
        uint256 betBalance = 0;
        uint256 n = 0;
        uint256 maxCompensate = 0;
        uint256 nominator = 1;
        uint256 denominator = 1;
        for (uint8 i=0; i<3; i++) {
            uint8 subType = betType8 & (1 * 2**i);
            if (subType != 0) {
                require(betValue.length >= (n+1)*10, "Missing bet values!");
                nominator = room.nominator[i];
                denominator = room.denominator[i];
                for (uint8 j=0; j<10; j++){
                    maxCompensate = SafeMath.add(maxCompensate, betValue[n*10+j] * denominator / nominator);
                    betBalance = SafeMath.add(betBalance, betValue[n*10 + j]);
                }
                maxCompensate = SafeMath.add(maxCompensate, room.currentMaxCompensate);
                require(maxCompensate <= room.lastLockedValue, "Cannot bet over compensate!");
                n++;
            }
        }
        require(betValue.length >= n*10, "Missing bet values!");
        //Now check the bet tail info, format is
        //[n, block1, len1, tail1_1, value1_1, tail2_1, value2_1, … , tail1_len1, value1_len1, … , 
        //    blockn, lenm, tailn_1, value_num, … , tailn_m, valuen_m]
        n = n*10;
        if (((betType8 & 0x8) == 0x8) && betValue.length > n) {
            uint256 total_block = betValue[n++];
            require(betValue.length > n, "betTailInfo format wrong!");
            nominator = room.nominator[3];
            denominator = room.denominator[3];
            for (uint256 i=0; i<total_block; i++) {
                uint256 block_num = betValue[n++];
                uint256 tail_num = betValue[n++];
                require(betValue.length >= n + tail_num*2, "betTailInfo format wrong!");
                require(block_num >= 0 && block_num <= 9, "betTail block num must between [0-9]!");
                for (uint256 j=0; j<tail_num;j++) {
                    uint256 bet_value = betValue[n+1];
                    uint256 compensate = bet_value * denominator / nominator;
                    maxCompensate = SafeMath.add(maxCompensate, compensate);
                    betBalance = SafeMath.add(betBalance, bet_value);
                    n+=2;
                }
            }
            require(maxCompensate <= room.lastLockedValue, "Cannot bet over compensate!");
        }

        if (CheckTransferFrom(room.erc20Addr, msg.sender, address(this), betBalance)) {
            Round storage round = room.rounds[roundId];
            round.totalBetValue = SafeMath.add(round.totalBetValue, betBalance);
            room.currentMaxCompensate = SafeMath.add(room.currentMaxCompensate, maxCompensate);

            round.orderNum = SafeMath.add(round.orderNum, 1);
            BetOrder memory newOrder;
            newOrder.roomId = roomId;
            newOrder.roundId = roundId;
            newOrder.orderId = round.orderNum;
            newOrder.totalValue = betBalance;
            newOrder.betType = betType;
            newOrder.betValue = betValue;
            newOrder.gain = 0;
            newOrder.owner=msg.sender;
            round.orders[round.orderNum] = newOrder;
            emit NewBetOrder(roomId, roundId, round.orderNum, betBalance);
            return round.orderNum;
        }
        return 0;
    }
}
